import React,{useEffect,useState} from 'react'

const Navbar = () => {
    const [uname, setuname] = useState();
    const [islog, setislog] = useState(false);
      useEffect(() => {
          if (sessionStorage.getItem("users") != null) {
            const user = sessionStorage.getItem("users");
            const users = JSON.parse(user)
            setuname(users.uname)
            setislog(true)
          }
        },[islog,uname])
    return (
        <>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="container-fluid">
                    <a className="navbar-brand bran" href='/'>CodeSolution</a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav ms-auto">
                            <li className="nav-item">
                                <a className="nav-link" aria-current="page" href="/designTemp">Template</a>
                            </li>

                            <li className="nav-item">
                                <a className="nav-link" href="/Api">Animation</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="/Api">APIs</a>
                            </li>
                            {
                                islog? <li className="nav-item"><a className="nav-link" href='/setting'>Setting </a></li>
                                :''
                            }

                            <li className="nav-item">
                                {
                                    islog ?<a className="nav-link" href='/'>{uname} </a>:
                                    ''
                                }

                            </li>
                            <li className="nav-item">
                                {
                                    islog ?<a className="nav-link" href='/' onClick={logout}>LOGOUT </a>:
                                    <a className="nav-link" href="/login">LOGIN</a>
                                }

                            </li>


                        </ul>
                    </div>
                </div>
            </nav>
        </>
    )
}

export default Navbar
